import styled from "styled-components";

function SectionProject() {
  return (
    <Container>
      <Slider>
        <TextBanner>KEEP GOING</TextBanner>
        <TextBanner>KEEP GOING</TextBanner>
      </Slider>
    </Container>
  );
}

export default SectionProject;

const Container = styled.div`
  width: 100%;
`;

const Slider = styled.div`
  width: 1010px;
  height: 300px;

  overflow: hidden;
  position: relative;
`;

const TextBanner = styled.h3`
  padding: 20px;
  font-weight: ${({ theme }) => theme.fonts.weightExtra};
  font-size: 110px;
  color: #000;
`;
